import React, { Component } from 'react';
import Vacation from '../../models/Vacation';
import { store } from '../../Redux/Store';
import './adminPage.css';

interface AllVacationsState {
    allVacations : Vacation[];
}

export default class AdminPage extends Component <any, AllVacationsState> {

    constructor(props : any) {
        super(props)
    
        this.state = {
             allVacations: store.getState().allVacations
        }

        console.log(this.state.allVacations);
        
    }
    


    render() {
        return (
            <div>
                <div className="adminActionsBar"></div>
            </div>
        )
    }
}
